import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
import '././bootstrap/bootstrap.css';



class FirstDiv extends Component {

  fillthenumbers = {
    firstnum: 1
  }
  render(){

    return(
      <div className="FirstDiv">

        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <a className="navbar-brand" href="#">TheSenseGuy</a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item active">
                <a className="nav-link" href="#">Click to end of page   <span class="sr-only">(current)</span></a>
              </li>
            </ul>
          </div>
        </nav>

        <div className="container-fluid bg-light">
          <div className="row">
            <div className="col-md-6 mx-auto">
              <h1><b>Thank you</b> for Visiting my Resume</h1>
            </div>
            <div className="col-md-6 mx-auto">
              <h3><b>You are</b> visitor number {this.fillthenumbers.firstnum}</h3>
            </div>
          </div>



        </div>

      </div>

    )

  }

}





